import React, {useState} from 'react';

const App = () =>{
const [input, setinput] = useState(6);
const [progresss, setprogress] = useState(25);


    return(
        <>
        <progress value={progresss} onChange={(e) =>{
            setprogress(e.target.value);
        }} style={{height:'50px', width:'300px'}} max="100">{progresss}</progress>
        <br/>
        <input type="text" value={input} onChange={(e) =>{
            setinput(e.target.value);
            if(input == 6){
                setprogress(25);
            }
            else if(input == 16){
                setprogress(50);
            }
            else if(input == 24){
                setprogress(75);
            }
            else if(input == 32){
                setprogress(99);
            }
        }}/>
        
          </>
    )
}
export default App;
